export function doQuickSort(array) {
    console.log('array:', array);
    return;
  }

function quickSort(arr, start, end) {
    if (start >= end) {
        return;
    }
    let index = partition(arr, start, end);
    quickSort(arr, start, index-1);
    quickSort(arr, index+1, end);
}

function partition() {
    return;
}
